// SPDX-License-Identifier: MIT
pragma solidity ^0.8.30;

interface IReceiver {
    function Sum(uint _num1, uint _num2) external returns(uint);
    function Dif(uint _num1, uint _num2) external returns(uint);
    function Prod(uint _num1, uint _num2) external returns(uint);
    function Quo(uint _num1, uint _num2) external returns(uint);
}

/////////////////////////////// Receiver
contract Receiver {
    uint public num1;
    uint public num2;
    
    function Sum(uint _num1, uint _num2) external returns(uint){
        num1 = _num1;
        num2= _num2;
        return num1+num2;
    }
    function Dif(uint _num1, uint _num2) external returns(uint){
        num1 = _num1;
        num2=_num2;
            if (num2 > num1) {
                return 0;
            }
        return num1-num2;
    }
     function Prod(uint _num1, uint _num2) external returns(uint){
        num1 = _num1;
        num2=_num2;
        return _num1*_num2;
    }
     function Quo(uint _num1, uint _num2) external returns(uint){
        num1 = _num1;
        num2=_num2;
        require(num2 != 0, "Division by zero is not allowed");
        return _num1/_num2;
    }
}



///////////////////////////////Caller
contract Caller {
    function callSum(address receiverAddress, uint _num1, uint _num2) external returns(uint) {
        return IReceiver(receiverAddress).Sum(_num1, _num2);
    }

    function callDifference(address receiverAddress, uint _num1, uint _num2) external returns(uint) {
        return IReceiver(receiverAddress).Dif(_num1, _num2);
    }

    function callProduct(address receiverAddress, uint _num1, uint _num2) external returns(uint) {
        return IReceiver(receiverAddress).Prod(_num1, _num2);
    }

    function callQuotient(address receiverAddress, uint _num1, uint _num2) external returns(uint) {
        return IReceiver(receiverAddress).Quo(_num1, _num2);
    }
}

